import React, { Component } from 'react';
import './App.css';
import Todoapp from "./component/Todoapp";
class App extends Component {
  constructor(props) {
    super(props);
    this.state.title = [
      { title: 'mua banh', isComplete: true},
      { title : 'mua keo',},
      { title : 'mua bim bim',}
    ]
  }

  render() {

      if(this.Todoapp.length){
        return (
          <div className ="App"></div>
        );
      }

  }
}

export default App;
